div.div:
Suppose N is nilpotent. Then there exists vectors v1 ..., vn and nonnegative integers m1, ... , mn such that:
1) N^m1(v1), ... N(v1), v1, ... , N^mn(vn), ... , N(vn), vn is a basis of V;
2) N^m1+1(v1) = ... = N^mn+1(vn) = 0

div.span:
Inner product space: if U is an invariant subspace under T,
1) orthogonal complement of U is invariant under T;
2) U is invariant under T*.
